import Button from "react-bootstrap/Button";

function Delete(props) {
  const handleDelete = () => {
    props.handleDelete(props.index);
  };

  return (
    <Button
      style={{ width: "5rem" }}
      onClick={handleDelete}
      variant="outline-danger"
    >
      Delete
    </Button>
  );
}

export default Delete;
